import React from "react";
import "./Timer.css";

const Timer = (props) => {
    return (
        <div>
            <div className="digits">{("0" + Math.floor((props.time / 60000) % 60)).slice(-2)}:</div>
            <div className="digits">{("0" + Math.floor((props.time / 1000) % 60)).slice(-2)}:</div>
            <span className="digits mili-sec">{("0" + ((props.time / 10) % 100)).slice(-2)}</span>
        </div>
    );
}

export default Timer
